//https://leetcode.com/problems/find-first-and-last-position-of-element-in-sorted-array
class Solution {
public:
    vector<int> searchRange(vector<int>& nums, int target) {
        int left = -1;
        int right = -1;

        int start = 0;
        int end = nums.size()-1;
        while(start <= end){
            int mid = (end - start)/2 + start;
            if(nums[mid] == target){
                left = mid;
                end = mid-1;
            }else if(nums[mid] > target){
                end = mid-1;
            }else{
                start = mid+1;
            }
        }

        if(left == -1){
            return {left, right};
        }
        start = left;
        end = nums.size()-1;
        while(start <= end){
            int mid = (end - start)/2 + start;
            if(nums[mid] == target){
                right = mid;
                start = mid+1;
            }else if(nums[mid] > target){
                end = mid-1;
            }else{
                start = mid+1;
            }
        }

        return {left, right};
    }
};

